import {
  Container,
  BreadcrumbItem,
  Row,
  Col,
  Breadcrumb,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button,
  Form,
  FormInput,
  FormGroup,
  Collapse,
  Badge
} from "shards-react";
import Head from "next/head";
import {
  BrowserView,
  MobileView,
  isBrowser,
  isMobile
} from "react-device-detect";
import QuizLayout from "../quiz-components/QuizLayout";
import SEO from "react-seo-component";
import Img from "react-image";
import Layout from "../components/Layout";

const Quiz = props => (
  <Layout>
    <SEO
      title={"CAPE Spanish | CXC Spanish Online"}
      pathname={"https://www.cxcspnish/mailing-list"}
      description={
        "The Caribbean Advanced Proficiency Examination (CAPE) is designed to provide certification of the academic, vocational and technical achievement of student."
      }
      siteLanguage={"en"}
      twitterUsername={"cxcspnish"}
      author={"Raheem McDonald"}
      article={false}
    />

    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>Quizes and Challenges</BreadcrumbItem>
      </Breadcrumb>

      <QuizLayout>
        <Card>
          <CardBody>
            <CardTitle>Quizes and Challenges</CardTitle>
          </CardBody>
        </Card>

        <br />
        <Card>
          <CardBody>
            <CardTitle>Advanced Challenges</CardTitle>
          </CardBody>
        </Card>
      </QuizLayout>
    </Container>
  </Layout>
);

export default Quiz;
